 * "beta users OR internal team members".
 *
 * Example AND configuration (must satisfy all conditions):
 * ```php
 * [
 *     \'enabled\' => true,
 *     \'strategy\' => \'composite\',
 *     \'operator\' => \'AND\',
 *     \'strategies\' => [
 *         [\'type\' => \'percentage\', \'percentage\' => 50],
